<html>
	
	<head>
		<style>
			div {
				background-color: transparent;
			}
			input:focus {
				outline-style: none;
				border: 2.5px solid rgba(129, 61, 232, 1);
	
			}
	
			input:hover {
				outline-style: none;
				border: 2.5px solid rgba(129, 61, 232, 0.7);
	
			}
	
			input {
				height: 50px;
				width: 70%;
				border-radius: 10px;
	
				text-decoration: none;
				border: 2px solid rgba(129, 61, 232, 0.5);
				margin-top: 20px;
				margin-bottom: 20px;
				font-family: Poppins;
				color: rgb(255, 255, 255);
				font-size: 14px;
				font-weight: 400;
				line-height: 21px;
				letter-spacing: 0em;
				text-align: left;
				padding-left: 20px;
				background: #18191F;
                font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue'
			}
	
	
			.checkbox input:checked~.checkbox::before {
				opacity: 1;
				border: 10px solid;
	
			}
	
			.checkbox-wrapper-42 {
				width: 70%;
			}
	
			.checkbox-wrapper-42 input[type="checkbox"] {
				display: none;
				visibility: hidden;
	
			}
	
			.checkbox-wrapper-42 label {
				display: inline-block;
			}
	
			.checkbox-wrapper-42 .cbx {
				position: relative;
				top: 1px;
				width: 30px;
				height: 30px;
				border: 1px solid rgba(129, 61, 232, 0.7);
				border-radius: 3px;
				vertical-align: middle;
				transition: background 0.1s ease;
				cursor: pointer;
			}
	
			.checkbox-wrapper-42 .cbx:after {
				content: '';
				position: absolute;
				top: 1px;
				left: 9px;
				width: 9px;
				height: 25px;
				opacity: 0;
				transform: rotate(45deg) scale(0);
				border-right: 2px solid #fff;
				border-bottom: 2px solid #fff;
				transition: all 0.3s ease;
				transition-delay: 0.15s;
			}
	
			.checkbox-wrapper-42 .lbl {
				margin-left: 5px;
				vertical-align: middle;
				cursor: pointer;
				font-family: Poppins;
				font-size: 16px;
				font-weight: 400;
				line-height: 24px;
				letter-spacing: 0em;
				text-align: left;
			}

							<div class="main">
					
								<h2 style="font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue';
								font-size: 24px;
								font-weight: 600;
								line-height: 36px;
								letter-spacing: 0em;
								text-align: left;
								margin-bottom: 0px;
								color: #ffffff;
								cursor: pointer;
				
								">Sign in</h2>
								<h4 style="font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
								font-size: 16px;
								font-weight: 300;
								line-height: 36px;
								letter-spacing: 0em;
								text-align: left;
								margin-bottom: 0px;
								margin-top: 0px;
								color: #ffffff;
				
								">Log in to your account </h4>
								

					
					
								<input id="emailField" placeholder="Email">
								<input id="passwordField" placeholder="Password" type="password">
								
					
								<button id="submit" onclick=submitInput() style="font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue'">Next</button>
								<h4 style="margin-bottom: 48px; color: #ffffff; font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue'; font-weight: 300;">Don't have an account <span class="new" style="color: #8C30F5; cursor:pointer;" onclick=showLoginPanel()>Sign up</span></h4>
							</div>
						</div>
		</div>
		<script>
			vscode = acquireVsCodeApi();
			function submitInput() {
				const emailField = document.getElementById('emailField').value;
				const passwordField = document.getElementById('passwordField').value;
				vscode.postMessage({ command: 'submit', value: {
					email: emailField, 
					password: passwordField,
				} });
			}
			function showLoginPanel(){
				vscode.postMessage({ command: 'showRegisterPanel', value: {
					show:"true"
				} });
			}
		</script>
